## Early thoughts, originall I was thinking about removing the As a Ts
## but we still need their location. I feel like there is some optimization
## that can exist in not iterating over them. 
def MinimumSkew(Genome: str):
    cur_val = 0
    index = 0
    cur_min = 0
    min_locs = list()
    for nucleotide in Genome:
        ## Add or subtract values
        if nucleotide == "C":
            cur_val -= 1
        elif nucleotide == "G":
            cur_val += 1
         ## Increase index
        index += 1
        # print(cur_val, " ", index)
        ## If cur value is lower than the current minimum
        if cur_val < cur_min:
            cur_min = cur_val
            min_locs = [index]
        elif cur_val == cur_min:
            min_locs.append(index)
        
    return(min_locs)


